<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width,initial-scale=1.0">
  <link rel="icon" href="<%= BASE_URL %>favicon.ico">
  <title><%= htmlWebpackPlugin.options.title %></title>
  <link rel="stylesheet" href="<%= BASE_URL %>cdn/iconfont/iconfont.css">
  <link rel="stylesheet" href="<%= BASE_URL %>css/common.css">
  <!-- <link href="https://cdn.bootcdn.net/ajax/libs/element-ui/2.13.2/theme-chalk/index.css" rel="stylesheet"> -->
  <link href="<%= BASE_URL %>cdn/element-ui/theme-chalk/2.13.2.element.index.css" rel="stylesheet">
</head>

<body>
  <noscript>
    <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled.
      Please enable it to continue.</strong>
  </noscript>
  <script src="https://cdn.bootcdn.net/ajax/libs/vue/2.6.11/vue.min.js"></script>
  <script src="https://cdn.bootcdn.net/ajax/libs/vue-router/3.1.3/vue-router.min.js"></script>
  <script src="https://cdn.bootcdn.net/ajax/libs/vuex/3.1.3/vuex.min.js"></script>
  <script src="https://cdn.bootcdn.net/ajax/libs/axios/0.19.2/axios.min.js"></script>
  <script src="https://cdn.bootcdn.net/ajax/libs/element-ui/2.13.2/index.js"></script>
  <script>
    if (typeof Vue == 'undefined') {
      document.write(unescape("%3Cscript src='<%= BASE_URL %>cdn/vue/2.6.11.vue.min.js'%3E%3C/script%3E"))
    }
    if (typeof VueRouter == 'undefined') {
      document.write(unescape("%3Cscript src='<%= BASE_URL %>cdn/vue-router/3.1.3.vue-router.js'%3E%3C/script%3E"))
    }
    if (typeof Vuex == 'undefined') {
      document.write(unescape("%3Cscript src='<%= BASE_URL %>cdn/vuex/3.1.3.vuex.js'%3E%3C/script%3E"))
    }
    if (typeof axios == 'undefined') {
      document.write(unescape("%3Cscript src='<%= BASE_URL %>cdn/axios/0.19.2/axios.js'%3E%3C/script%3E"))
    }
    if (typeof ELEMENT == 'undefined') {
      document.write(unescape("%3Cscript src='<%= BASE_URL %>cdn/element-ui/2.13.2.element.index.js'%3E%3C/script%3E"))
    }
  </script>
  <div id="app"></div>
  <!-- built files will be auto injected -->
</body>

</html>
